def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    parts = input1.split()
    result = []
    for part in parts:
        subparts = part.split('-')
        transformed_subparts = [subpart.capitalize() if i > 0 else subpart for i, subpart in enumerate(subparts)]
        result.append(''.join(transformed_subparts))
    return ' '.join(result)
